import React, { Component } from 'react';
import {ART} from 'react-native'
const {Surface, Shape, Group,Path} = ART;

const createIcon=(width,height,scale,color,path)=>{

    return (
        <Surface
        width={width}
        height={height}
        >
        <Group scale={scale}>
            <Shape
                fill={color}
                d={path}
            />
        </Group>
      </Surface>
    )
}


